    data: |
      SELECT DISTINCT - col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col1 BETWEEN ( + col0 + col1 * col2 ) AND + col0;
  - name: tab1

outputs:
  - name: q10736.out
    data: |
      -10
      -13
      -26
